        public void Print(
            IWeatherGetter item,
            StructuredStringBuilder sb,
            string? name = null,
            Weather.Mask<bool>? printMask = null)
        {
            if (name == null)
            {
                sb.AppendLine($"Weather =>");
            }
            else
            {
                sb.AppendLine($"{name} (Weather) =>");
